import React, { useState } from "react";
import { Card, CardActionArea, CardContent, CardMedia, Typography, Dialog, DialogContent } from "@mui/material";

const PhotoCard = ({ image }) => {
	const [open, setOpen] = useState(false);

	const handleClickOpen = () => {
		setOpen(true);
	};

	const handleClose = () => {
		setOpen(false);
	};

	return (
		<>
			<Card sx={{ maxWidth: 345 }}>
				<CardActionArea onClick={handleClickOpen}>
					<CardMedia
						component="img"
						height="300px"
						width="auto"
						image={image.url}
						alt={image.title}
					/>
					<CardContent>
						<Typography gutterBottom variant="h5" component="div">
							{image.title}
						</Typography>
						<Typography variant="body2" color="text.secondary">
							{image.title}
						</Typography>
					</CardContent>
				</CardActionArea>
			</Card>

			<Dialog
				open={open}
				onClose={handleClose}
			>
				<DialogContent>
					<img src={image.url} alt={image.title} style={{ maxWidth: "100%", maxHeight: "100%" }} />
				</DialogContent>
			</Dialog>
		</>
	);
};

export default PhotoCard;
